ECMAScript/ES2016 and ES2017.html.body:
1. 背景
1.1 谁设计的ECMAScript？
TC39 (Technical Committee 39).
TC39是一个旨在推动JavaScript发展的委员会，它的成员组成主要来自各大浏览器厂商，这些成员也会经常邀请各大专家进行定期的会议对ECMAScript进行讨论。
1.2 ECMAScript是如何被筹划的？
1.2.1 ECMAScript2015(ES6)是一次大型的发布
ES6较之ES5(December 2009 vs June 2015)来说，是一次标准化的大型发布，这两次发布之间时隔近6年，其主要原因有二：

许多特性很早以前就已经定稿，但是不得不等到正式发布
有一些特性需要花费很长时间去定稿，但是如果一旦推迟到下一次发布，那么将又是一次漫长的等待，故而影响了ES6的发布时间

吸取以上教训后，从ECMAScript 2016(ES7)开始，将会进行更小粒度和更频繁的发布，以后每年都将会有一次发布，发布的内容会包含所有已经定稿的特性。
1.2.2 TC39的流程
每一个有关ECMAScript新特性的提案都将经历一系列Stage，开始为Stage0，从一个Stage到下一个Stage都必须由TC39批准才可以。
1.2.2.1 Stage0:strawman
此时只是一些有关ECMAScript新特性的自由想法，但该想法必须是由TC39成员或者是已经注册成为TC39贡献者的成员提出。
1.2.2.2 Stage1:proposal
在Stage0的基础上，有一些例子和详细的说明作为提案，方便TC39专家去审核和测试。
1.2.2.3 Stage2:draft
这可以算得上是该特性的第一个修订版，此时对于该特性应该有对应的实现，尽管它还是试验性的。
1.2.2.4 Stage3:candidate
该提案已经基本完成，现阶段主要收集使用的反馈，是有很大的机会被加入到最近一次发布中的。
1.2.2.5 Stage4:finished
该提案即将被纳入标准，等待发布。
1.3 不要用&quot;ECMAScript 20xx features&quot;这种描述
如上所述，一旦一个提案到达Stage4后，它将会被纳入标准，这没错。但它就一定会在这次发布中吗？其实并不是100%肯定的，也许会很耗时。所以不要轻易去说&quot;ES7 features&quot;或者&quot;ES2016 features&quot;等词汇，如果要说，还是用&quot;proposal&quot;或者注明其Stage比较好一些。
如果一个feature已经到了Stage4了，那么称它为ES20xx feature也不为过，但是为了保险起见，还是等它真正出现在这次发布中在这么称呼它比较好一些。Object.observe就是一个例子，它已经到达了Stage2了，但最终还是被取消了。
2. ECMAScript 2017
2.1 ES proposal: Object.entries() and Object.values()
2.1.1 Object.entries()
let obj = { one: 1, two: 2 };
for (let [k,v] of Object.entries(obj)) {
    console.log(k,v);
}
// Output:
// one 1
// two 2
2.1.2 Object.values()
Object.values({ one: 1, two: 2 })
// Output:
[1,2]
2.1.3 FAQ

为什么Object.values()返回的是数组而不是迭代器?
为什么Object.values()只能返回可枚举的属性？

主要是为了和Object.keys()保持一致。
2.2 New string methods: padStart and padEnd
2.2.1 ECMAScript 2017将会有以下两个方法：
&gt; &#39;x&#39;.padStart(5, &#39;ab&#39;)
&#39;ababx&#39;
&gt; &#39;x&#39;.padEnd(5, &#39;ab&#39;)
&#39;xabab&#39;
2.2.2 它们有什么用途

在表格中显示等宽字体
为ID，文件名或者URL加入标示：file 001.txt
console的输出可以对齐：Test 001: ✓
打印有固定位数的16进制或者2进制数

2.2.3 为什么不叫padLeft和padRight
其实主要是为了与现有的startsWith和endWith保持一致。
2.3 Object.getOwnPropertyDescriptors()
2.3.1
Object.getOwnPropertyDescriptors(obj)将会把obj中所有属性的描述符以数组的形式返回：
var obj = {
    name: &#39;John&#39;,
    age: 18
};
console.log(Object.getOwnPropertyDescriptors(obj));

{ 
    name: { 
     value: &#39;John&#39;,
     writable: true,
     enumerable: true,
     configurable: true 
  },
  age: { 
     value: 18,
     writable: true,
     enumerable: true,
     configurable: true 
  } 
}
2.3.2 用途
2.3.2.1 将属性拷贝到对象中
其实在ES6中已经可以利用Object.assign去给一个对象复值，它用key比较逐一赋值，而且并不是所有的属性它都能访问，比如利用Object.getOwnPropertyDescriptor可得如下信息：
const source = {
    set foo(value) {
        console.log(value);
    }
};
console.log(Object.getOwnPropertyDescriptor(source, &#39;foo&#39;));
// { get: undefined,
//   set: [Function: foo],
//   enumerable: true,
//   configurable: true }
而用Object.assign：
const target1 = {};
Object.assign(target1, source);
console.log(Object.getOwnPropertyDescriptor(target1, &#39;foo&#39;));
// { value: undefined,
//   writable: true,
//   enumerable: true,
//   configurable: true }
Object.assign不能拷贝getters, setters, non-writable等属性。
取而代之的办法则是Object.defineProperties和Object.getOwnPropertyDescriptors一起使用:
const target2 = {};
Object.defineProperties(target2, Object.getOwnPropertyDescriptors(source));
console.log(Object.getOwnPropertyDescriptor(target2, &#39;foo&#39;));
// { get: undefined,
//   set: [Function: foo],
//   enumerable: true,
//   configurable: true }
2.3.2.2 浅拷贝
利用ES2017，浅拷贝时Object.create的第二个参数就会方便：
const clone = Object.create(Object.getPrototypeOf(obj),
    Object.getOwnPropertyDescriptors(obj));
2.4 Trailing commas in function parameter lists and calls
在ES2017里，如下语法将会变为合法：
2.4.1 方法的参数列表
function foo(
    param1,
    param2,
) {}
foo(
    &#39;abc&#39;,
    &#39;def&#39;,
);
2.4.2 数组和对象
let obj = {
    first: &#39;Jane&#39;,
    last: &#39;Doe&#39;,
};
let arr = [
    &#39;red&#39;,
    &#39;green&#39;,
    &#39;blue&#39;,
];
console.log(arr.length); // 3
2.4.3 好处

不用检测是否在最后一项得删除逗号
比较利于版本检测(code diff的显示)

